            "sentence":"Aldus Pius Manutius ( ; ; 1449\/14526 February 1515 ) was an Italian humanist , scholar , educator , and the founder of the Aldine Press . Manutius devoted the later part of his life to publishing and disseminating rare texts . His interest in and preservation of Greek manuscripts mark him as an innovative publisher of his age dedicated to the editions he produced . His `` enchiridia '' , small portable books , revolutionized personal reading and are the predecessor of the modern paperback . Manutius wanted to produce Greek texts for his readers because he believed that works by Aristotle or Aristophanes in their original Greek form were pure and unadulterated by translation .",
