            "sentence":"Liutprand , also Liudprand , Liuprand , Lioutio , Liucius , Liuzo , and Lioutsios ( c 920 \u2013 972 ) , was a historian , diplomat , and Bishop of Cremona born in what is now northern Italy , whose works are an important source for the politics of the 10th century Byzantine court . Liutprand was born into a prominent family from Pavia , of Lombard origins , around 920 . In 931 he entered service as page to Hugh of Arles , who kept court at Pavia as King of Italy and who married the notorious and powerful Marozia of Rome . Liutprand was educated at the court and became a Deacon at the Cathedral of Pavia . After Hugh died in 947 , leaving his son and co-ruler Lothair on the throne as King of Italy , Liutprand became confidential secretary to the actual ruler of Italy , Berengar II , marchese d'Ivrea , for whom he became chancellor .",
