            "sentence":"In 949 , Berengar II sent him on a goodwill mission as an apprentice diplomat to the Byzantine court of Constantine VII Porphyrogenitus , with whom he became friendly . Liutprand went partly to learn Greek and may have provided material for chapter 26 of Constantine VII 's `` De Administrando Imperio `` . Both Liutprand 's father and his stepfather had been sent as ambassadors to Constantinople ( 927 and 942 ) . Liutprand included in his later `` Antapodosis '' ( 950s ) , a glowing account of the hospitality he enjoyed there , including being carried into the audience hall on the shoulders of eunuch s , and Constantine 's delight in receiving a gift of four `` de luxe '' eunuchs . On his return , however , he fell out with Berengar , for which Liutprand avenged himself in his `` Antapodosis '' ( `` retribution '' ) , and attached himself to Berengar 's rival , the emperor Otto I , who became King of Italy upon the death of Lothair in 950 .",
